import React from 'react';
import { useNavigate } from 'react-router-dom';
import { openChatbot } from '../utils/chatbot';

function Dashboard({ user, logout }) {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen" style={{ background: '#f8f9fa' }}>
      {/* Header */}
      <header className="nav-header">
        <div className="nav-container">
          <div className="nav-brand">
            <span className="page-title-icon">üè¶</span>
            <span>ExpenseFlow</span>
          </div>
          <div className="flex items-center gap-4">
            <span className="text-secondary">Welcome, {user?.username || 'User'}!</span>
            <button onClick={logout} className="btn btn-danger btn-sm">
              Logout
            </button>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main style={{ 
        maxWidth: '1200px', 
        margin: '0 auto', 
        padding: '40px 20px' 
      }}>
        {/* Hero Section */}
        <div style={{ 
          textAlign: 'center', 
          marginBottom: '50px',
          padding: '40px 20px',
          backgroundColor: 'white',
          borderRadius: '15px',
          boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)'
        }}>
          <h1 style={{ 
            fontSize: '2.5rem', 
            fontWeight: 'bold', 
            color: '#333',
            marginBottom: '15px',
            margin: 0
          }}>
            Welcome back, {user?.username || 'User'}! üëã
          </h1>
          <p style={{ 
            fontSize: '1.2rem', 
            color: '#666',
            maxWidth: '600px',
            margin: '15px auto 0 auto',
            lineHeight: '1.6'
          }}>
            Ready to manage your expenses? Split bills, track spending, and settle up with friends effortlessly.
          </p>
        </div>

        {/* Dashboard Cards Grid */}
        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
          gap: '25px',
          marginBottom: '40px'
        }}>
          {/* Groups Card */}
          <div style={{
            backgroundColor: 'white',
            borderRadius: '15px',
            padding: '30px',
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
            cursor: 'pointer',
            transition: 'transform 0.2s, box-shadow 0.2s',
            border: '1px solid #e0e0e0'
          }}
          onClick={() => navigate('/groups')}
          onMouseEnter={(e) => {
            e.target.style.transform = 'translateY(-5px)';
            e.target.style.boxShadow = '0 8px 15px rgba(0, 0, 0, 0.15)';
          }}
          onMouseLeave={(e) => {
            e.target.style.transform = 'translateY(0)';
            e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
          }}>
            <div style={{ fontSize: '48px', marginBottom: '20px', textAlign: 'center' }}>üë•</div>
            <h3 style={{ fontSize: '20px', fontWeight: 'bold', color: '#333', marginBottom: '15px', textAlign: 'center' }}>
              Manage Groups
            </h3>
            <p style={{ color: '#666', textAlign: 'center', lineHeight: '1.5', margin: 0 }}>
              Create trip groups, add members, and organize your expenses
            </p>
          </div>

          {/* Expenses Card */}
          <div style={{
            backgroundColor: 'white',
            borderRadius: '15px',
            padding: '30px',
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
            cursor: 'pointer',
            transition: 'transform 0.2s, box-shadow 0.2s',
            border: '1px solid #e0e0e0'
          }}
          onClick={() => navigate('/expenses')}
          onMouseEnter={(e) => {
            e.target.style.transform = 'translateY(-5px)';
            e.target.style.boxShadow = '0 8px 15px rgba(0, 0, 0, 0.15)';
          }}
          onMouseLeave={(e) => {
            e.target.style.transform = 'translateY(0)';
            e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
          }}>
            <div style={{ fontSize: '48px', marginBottom: '20px', textAlign: 'center' }}>üí∞</div>
            <h3 style={{ fontSize: '20px', fontWeight: 'bold', color: '#333', marginBottom: '15px', textAlign: 'center' }}>
              Track Expenses
            </h3>
            <p style={{ color: '#666', textAlign: 'center', lineHeight: '1.5', margin: 0 }}>
              Add expenses, split bills, and see who owes what
            </p>
          </div>

          {/* Analytics Card */}
          <div style={{
            backgroundColor: 'white',
            borderRadius: '15px',
            padding: '30px',
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
            cursor: 'pointer',
            transition: 'transform 0.2s, box-shadow 0.2s',
            border: '1px solid #e0e0e0'
          }}
          onClick={() => navigate('/analytics')}
          onMouseEnter={(e) => {
            e.target.style.transform = 'translateY(-5px)';
            e.target.style.boxShadow = '0 8px 15px rgba(0, 0, 0, 0.15)';
          }}
          onMouseLeave={(e) => {
            e.target.style.transform = 'translateY(0)';
            e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
          }}>
            <div style={{ fontSize: '48px', marginBottom: '20px', textAlign: 'center' }}>üìä</div>
            <h3 style={{ fontSize: '20px', fontWeight: 'bold', color: '#333', marginBottom: '15px', textAlign: 'center' }}>
              View Analytics
            </h3>
            <p style={{ color: '#666', textAlign: 'center', lineHeight: '1.5', margin: 0 }}>
              See spending patterns, individual contributions, and category breakdowns
            </p>
          </div>

          {/* Settlement Tracking Card */}
          <div style={{
            backgroundColor: 'white',
            borderRadius: '15px',
            padding: '30px',
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
            cursor: 'pointer',
            transition: 'transform 0.2s, box-shadow 0.2s',
            border: '1px solid #e0e0e0'
          }}
          onClick={() => navigate('/settlements')}
          onMouseEnter={(e) => {
            e.target.style.transform = 'translateY(-5px)';
            e.target.style.boxShadow = '0 8px 15px rgba(0, 0, 0, 0.15)';
          }}
          onMouseLeave={(e) => {
            e.target.style.transform = 'translateY(0)';
            e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
          }}>
            <div style={{ fontSize: '48px', marginBottom: '20px', textAlign: 'center' }}>üßæ</div>
            <h3 style={{ fontSize: '20px', fontWeight: 'bold', color: '#333', marginBottom: '15px', textAlign: 'center' }}>
              Settlement Tracking
            </h3>
            <p style={{ color: '#666', textAlign: 'center', lineHeight: '1.5', margin: 0 }}>
              Track who owes what and record payments between group members
            </p>
          </div>

          {/* Khata Book Card */}
          <div style={{
            backgroundColor: 'white',
            borderRadius: '15px',
            padding: '30px',
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
            cursor: 'pointer',
            transition: 'transform 0.2s, box-shadow 0.2s',
            border: '1px solid #e0e0e0'
          }}
          onClick={() => navigate('/khatabook')}
          onMouseEnter={(e) => {
            e.target.style.transform = 'translateY(-5px)';
            e.target.style.boxShadow = '0 8px 15px rgba(0, 0, 0, 0.15)';
          }}
          onMouseLeave={(e) => {
            e.target.style.transform = 'translateY(0)';
            e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
          }}>
            <div style={{ fontSize: '48px', marginBottom: '20px', textAlign: 'center' }}>üìö</div>
            <h3 style={{ fontSize: '20px', fontWeight: 'bold', color: '#333', marginBottom: '15px', textAlign: 'center' }}>
              Khata Book
            </h3>
            <p style={{ color: '#666', textAlign: 'center', lineHeight: '1.5', margin: 0 }}>
              View complete transaction history and ledger for all groups
            </p>
          </div>

          {/* Personal Khata Card */}
          <div style={{
            backgroundColor: 'white',
            borderRadius: '15px',
            padding: '30px',
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
            cursor: 'pointer',
            transition: 'transform 0.2s, box-shadow 0.2s',
            border: '1px solid #e0e0e0'
          }}
          onClick={() => navigate('/personal-khata')}
          onMouseEnter={(e) => {
            e.target.style.transform = 'translateY(-5px)';
            e.target.style.boxShadow = '0 8px 15px rgba(0, 0, 0, 0.15)';
          }}
          onMouseLeave={(e) => {
            e.target.style.transform = 'translateY(0)';
            e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
          }}>
            <div style={{ fontSize: '48px', marginBottom: '20px', textAlign: 'center' }}>üìî</div>
            <h3 style={{ fontSize: '20px', fontWeight: 'bold', color: '#333', marginBottom: '15px', textAlign: 'center' }}>
              Personal Khata
            </h3>
            <p style={{ color: '#666', textAlign: 'center', lineHeight: '1.5', margin: 0 }}>
              Manage your personal customers and track outstanding amounts
            </p>
          </div>

          {/* Profile Card */}
          <div style={{
            backgroundColor: 'white',
            borderRadius: '15px',
            padding: '30px',
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
            cursor: 'pointer',
            transition: 'transform 0.2s, box-shadow 0.2s',
            border: '1px solid #e0e0e0'
          }}
          onClick={() => navigate('/profile')}
          onMouseEnter={(e) => {
            e.target.style.transform = 'translateY(-5px)';
            e.target.style.boxShadow = '0 8px 15px rgba(0, 0, 0, 0.15)';
          }}
          onMouseLeave={(e) => {
            e.target.style.transform = 'translateY(0)';
            e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
          }}>
            <div style={{ fontSize: '48px', marginBottom: '20px', textAlign: 'center' }}>üë§</div>
            <h3 style={{ fontSize: '20px', fontWeight: 'bold', color: '#333', marginBottom: '15px', textAlign: 'center' }}>
              Profile
            </h3>
            <p style={{ color: '#666', textAlign: 'center', lineHeight: '1.5', margin: 0 }}>
              Manage your account settings and view your activity stats
            </p>
          </div>
        </div>

        {/* Quick Start Guide */}
        <div className="modern-card animate-fadeIn">
          <div className="modern-card-header">
            <h3 className="text-xl font-bold text-primary m-0">üöÄ Quick Start Guide</h3>
          </div>
          <div className="modern-card-body">
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
              {/* Step 1 */}
              <div 
                className="glass-card p-6 text-center cursor-pointer transition hover:scale-105"
                onClick={() => navigate('/groups')}
              >
                <div className="text-4xl mb-4">üë•</div>
                <h4 className="text-blue font-semibold mb-2">1. Create a Group</h4>
                <p className="text-sm text-secondary">Start by creating a trip or event group</p>
              </div>
              
              {/* Step 2 */}
              <div 
                className="glass-card p-6 text-center cursor-pointer transition hover:scale-105"
                onClick={() => navigate('/groups')}
              >
                <div className="text-4xl mb-4">‚úâÔ∏è</div>
                <h4 className="text-green font-semibold mb-2">2. Add Members</h4>
                <p className="text-sm text-secondary">Invite friends by their email addresses</p>
              </div>
              
              {/* Step 3 */}
              <div 
                className="glass-card p-6 text-center cursor-pointer transition hover:scale-105"
                onClick={() => navigate('/expenses')}
              >
                <div className="text-4xl mb-4">üí∞</div>
                <h4 className="text-yellow font-semibold mb-2">3. Add Expenses</h4>
                <p className="text-sm text-secondary">Record expenses and they'll be split automatically</p>
              </div>
              
              {/* Step 4 */}
              <div 
                className="glass-card p-6 text-center cursor-pointer transition hover:scale-105"
                onClick={() => navigate('/settlements')}
              >
                <div className="text-4xl mb-4">üßæ</div>
                <h4 className="text-purple font-semibold mb-2">4. Settle Up</h4>
                <p className="text-sm text-secondary">See who owes what and settle balances</p>
              </div>
            </div>
          </div>
        </div>

        {/* Help Section */}
        <div className="modern-card animate-fadeIn">
          <div className="modern-card-header">
            <h3 className="text-xl font-bold text-primary m-0">üí¨ Need Help?</h3>
          </div>
          <div className="modern-card-body">
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
              <div 
                className="glass-card p-6 text-center cursor-pointer transition hover:scale-105"
                onClick={openChatbot}
              >
                <div className="text-4xl mb-4">ü§ñ</div>
                <h4 className="text-blue font-semibold mb-2">AI Chat Support</h4>
                <p className="text-sm text-secondary">Get instant help 24/7 with our AI assistant</p>
              </div>
              
              <div 
                className="glass-card p-6 text-center cursor-pointer transition hover:scale-105"
                onClick={() => navigate('/help')}
              >
                <div className="text-4xl mb-4">‚ùì</div>
                <h4 className="text-green font-semibold mb-2">Help Center</h4>
                <p className="text-sm text-secondary">Browse FAQs and detailed guides</p>
              </div>
              
              <div className="glass-card p-6 text-center">
                <div className="text-4xl mb-4">üìû</div>
                <h4 className="text-yellow font-semibold mb-2">Direct Support</h4>
                <p className="text-sm text-secondary mb-3">Call us for immediate assistance</p>
                <a 
                  href="tel:+917000270580" 
                  className="text-blue font-semibold text-sm hover:underline"
                >
                  +91 7000270580
                </a>
              </div>
            </div>
          </div>
        </div>


      </main>
    </div>
  );
}

export default Dashboard;
